  parameter MAX_ERROR_COUNT = 1231; //uint32


 // Signals
  reg  i_clk; // boolean
  reg  i_clk_enable; // boolean
  reg  i_reset; // boolean
  reg  signed [11:0] i_iir_data; // sfix12_En11
  wire signed [27:0] o_iir_data; // sfix28_En22

  reg  tb_enb; // boolean
  wire srcDone; // boolean
  wire snkDone; // boolean
  wire testFailure; // boolean
  reg  tbenb_dly; // boolean
  reg  rdEnb; // boolean
  wire i_iir_data_data_log_rdenb; // boolean
  reg  [10:0] i_iir_data_data_log_addr; // ufix11
  reg  i_iir_data_data_log_done; // boolean
  reg  o_iir_data_testFailure; // boolean
  integer o_iir_data_errCnt; // uint32
  wire delayLine_out; // boolean
  wire expected_ce_out; // boolean
  reg  int_delay_pipe [0:1] ; // boolean
  wire o_iir_data_rdenb; // boolean
  reg  [10:0] o_iir_data_addr; // ufix11
  reg  o_iir_data_done; // boolean
  wire signed [27:0] o_iir_data_ref; // sfix28_En22
  reg  check1_Done; // boolean

 // Module Instances
  IIR_filter u_IIR_filter
    (
    .i_clk(i_clk),
    .i_clk_enable(i_clk_enable),
    .i_reset(i_reset),
    .i_iir_data(i_iir_data),
    .o_iir_data(o_iir_data)
    );


 // Block Statements
  // -------------------------------------------------------------
  // Driving the test bench enable
  // -------------------------------------------------------------

  always @(i_reset, snkDone)
  begin
    if (i_reset == 1'b0)
      tb_enb <= 1'b0;
    else if (snkDone == 1'b0 )
      tb_enb <= 1'b1;
    else begin
    # (i_clk_period * 2);
      tb_enb <= 1'b0;
    end
  end

  always @(posedge i_clk or negedge i_reset) // completed_msg
  begin
    if (~i_reset) begin 
       // Nothing to reset.
    end 
    else begin 
      if (snkDone == 1) begin
        if (testFailure == 0)
              $display("**************TEST COMPLETED (PASSED)**************");
        else
              $display("**************TEST COMPLETED (FAILED)**************");
      end
    end
  end // completed_msg;

  // -------------------------------------------------------------
  // System Clock (fast clock) and reset
  // -------------------------------------------------------------

  always  // clock generation
  begin // i_clk_gen
    i_clk <= 1'b1;
    # i_clk_high;
    i_clk <= 1'b0;
    # i_clk_low;
    if (snkDone == 1) begin
      i_clk <= 1'b1;
      # i_clk_high;
      i_clk <= 1'b0;
      # i_clk_low;
      $stop;
    end
  end  // i_clk_gen

  initial  // reset block
  begin // i_reset_gen
    i_reset <= 1'b0;
    # (i_clk_period * 2);
    @ (posedge i_clk);
    # (i_clk_hold);
    i_reset <= 1'b1;
  end  // i_reset_gen

  // -------------------------------------------------------------
  // Testbench clock enable
  // -------------------------------------------------------------

  always @ (posedge i_clk or negedge i_reset)
    begin: tb_enb_delay
      if (i_reset == 1'b0) begin
        tbenb_dly <= 1'b0;
      end
      else begin
        if (tb_enb == 1'b1) begin
          tbenb_dly <= tb_enb;
        end
      end
    end // tb_enb_delay

  always @(snkDone, tbenb_dly)
  begin
    if (snkDone == 0)
      rdEnb <= tbenb_dly;
    else
      rdEnb <= 0;
  end

  // -------------------------------------------------------------
  // Read the data and transmit it to the DUT
  // -------------------------------------------------------------

  always @(posedge i_clk or negedge i_reset)
  begin
    i_iir_data_data_log_task(i_clk,i_reset,
                             i_iir_data_data_log_rdenb,i_iir_data_data_log_addr,
                             i_iir_data_data_log_done);
  end

  assign i_iir_data_data_log_rdenb = rdEnb;

  always @ (i_iir_data_data_log_rdenb, i_iir_data_data_log_addr)
  begin // stimuli_i_iir_data_data_log_i_iir_data
    if (i_iir_data_data_log_rdenb == 1) begin
      i_iir_data <= # i_clk_hold i_iir_data_data_log_force[i_iir_data_data_log_addr];
    end
  end // stimuli_i_iir_data_data_log_i_iir_data

  // -------------------------------------------------------------
  // Create done signal for Input data
  // -------------------------------------------------------------

  assign srcDone = i_iir_data_data_log_done;


  always @( posedge i_clk or negedge i_reset)
    begin: ceout_delayLine
      if (i_reset == 1'b0) begin
        int_delay_pipe[0] <= 1'b0;
        int_delay_pipe[1] <= 1'b0;
      end
      else begin
        if (i_clk_enable == 1'b1) begin
        int_delay_pipe[0] <= rdEnb;
        int_delay_pipe[1] <= int_delay_pipe[0];
        end
      end
    end // ceout_delayLine

  assign delayLine_out = int_delay_pipe[1];

  assign expected_ce_out =  delayLine_out & i_clk_enable;

  // -------------------------------------------------------------
  //  Checker: Checking the data received from the DUT.
  // -------------------------------------------------------------

  always @(posedge i_clk or negedge i_reset)
  begin
    o_iir_data_task(i_clk,i_reset,
                    o_iir_data_rdenb,o_iir_data_addr,
                    o_iir_data_done);
  end

  assign o_iir_data_rdenb = expected_ce_out;

  assign o_iir_data_ref = o_iir_data_expected[o_iir_data_addr];


  always @ (posedge i_clk or negedge i_reset) // checker_o_iir_data
  begin
    if (i_reset == 0) begin
      o_iir_data_testFailure <= 0;
      o_iir_data_errCnt <= 0;
    end 
    else begin 
      if (o_iir_data_rdenb == 1 ) begin 
        if (o_iir_data !== o_iir_data_expected[o_iir_data_addr]) begin
           o_iir_data_errCnt <= o_iir_data_errCnt + 1;
           o_iir_data_testFailure <= 1;
               $display("ERROR in o_iir_data at time %t : Expected '%h' Actual '%h'", 
                    $time, o_iir_data_expected[o_iir_data_addr], o_iir_data);
           if (o_iir_data_errCnt >= MAX_ERROR_COUNT) 
             $display("Warning: Number of errors for o_iir_data have exceeded the maximum error limit");
        end

      end
    end
  end // checker_o_iir_data

  always @ (posedge i_clk or negedge i_reset) // checkDone_1
  begin
    if (i_reset == 0)
      check1_Done <= 0;
    else if ((check1_Done == 0) && (o_iir_data_done == 1) && (o_iir_data_rdenb == 1))
      check1_Done <= 1;
  end

  // -------------------------------------------------------------
  // Create done and test failure signal for output data
  // -------------------------------------------------------------

  assign snkDone = check1_Done;

  assign testFailure = o_iir_data_testFailure;

  // -------------------------------------------------------------
  // Global clock enable
  // -------------------------------------------------------------
  always @(snkDone, tbenb_dly)
  begin
    if (snkDone == 0)
      # i_clk_hold i_clk_enable <= tbenb_dly;
    else
      # i_clk_hold i_clk_enable <= 0;
  end

 // Assignment Statements



endmodule // filter_tb
